**Node.js Script**
```javascript
const express = require('express');
const app = express();

app.get('/product', (req, res) => {
  let products = [
    { name: 'Eagle',
    price: 100,
    level: 1
  },
  { name: 'Eagle',
    price: 200,
    level: 2
  },
  { name: 'Eagle',
    price: 300,
    level: 3
  }
  ];
  res.json(products);
});

app.listen(3000);
```
